- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XN\x1CFor the 5/27/11 $100.00 contra disbursement
    reported on Line 21b of this report and transferred to Line 23, the full purpose
    of disbursement should be noted as: In-Kind Consulting Services, see Line 23 item.
    This amount relates to an original $8,000.00 advance payment made to the National
    Association of Realtors for consulting services on 9/13/2010 and reported on Line
    21b of the October 2010 monthly report. Subsequently in 2010, we utilized $6,200.00
    of this advanced payment as consulting services attributable to independent expenditures
    & reflected as negative amounts subtracted from Line 21b and transferred to Line
    24.  In April 2011 we utilized $100.00 of this advance payment as consulting services
    attributable to In-Kind events & reflected as negative amounts subtracted from
    Line 21b and transferred to Line 23.  In May $100.00 of the original $8,000.00
    is being utilized as consulting services attributable to In-Kind events & reflected
    on Line 23 in this period, with the full purpose of disbursement as: Transfer
    from Line 21b to Line 23 attributed as consulting services on 5/27/11 for In-Kind
    event for Spencer Bachus. For Line 22 of this report, the following entries are
    refunds for contributions received by this committee that were unacceptable. Each
    entry we reference contains the payee, date & amount of disbursement, along with
    the original date of receipt. The following contributions represented by the refunds
    are reported as unitemized on the 6/20/11 monthly report: Florida RPAC $171.60
    on 5/31/11 orig recd 5/09/11; Indiana RPAC $64.50 on 5/26/11 orig recd 5/04/11.
    \  \n"
